module.exports = "<div class=\"container\">\n<section id='fb'>\n<h3 class=\"text-center\">Facebook Ads & Pages</h3>\n\n<div id=\"accordion\">\n        <div class=\"card\">\n          <div class=\"card-header\" id=\"headingOne\">\n            <h5 class=\"mb-0\">\n              <button class=\"btn btn-link\" data-toggle=\"collapse\" data-target=\"#collapseOne\" aria-expanded=\"true\" aria-controls=\"collapseOne\">\n                Facebook Ads\n              </button>\n            </h5>\n          </div>\n      \n          <div id=\"collapseOne\" class=\"collapse show\" aria-labelledby=\"headingOne\" data-parent=\"#accordion\">\n            <div class=\"card-body\">\n\n\n                    <p >Facebook over the past decade or so has become extremely busy. There are over a billion people on Facebook. From this huge prospect base, you can be sure that there will be people interested in your services or products.\n                            Facebook ads are cost effective, targeted, filtered by demographics, location specific and extremely useful. You can start advertising on Facebook for very cheap and there's no limit to how much you can invest.\n                            You choose the amount you want to invest and Facebook gives you what you pay for; cost effective advertising solutions.\n                            There are many configurations for an advertising campaign on Facebook. You can choose setups to get more website traffic, page likes or app downloads. There is a solution for everybody.\n                        </p>            </div>\n          </div>\n        </div>\n        <div class=\"card\">\n          <div class=\"card-header\" id=\"headingTwo\">\n            <h5 class=\"mb-0\">\n              <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapseTwo\" aria-expanded=\"false\" aria-controls=\"collapseTwo\">\n                Pages\n              </button>\n            </h5>\n          </div>\n          <div id=\"collapseTwo\" class=\"collapse\" aria-labelledby=\"headingTwo\" data-parent=\"#accordion\">\n            <div class=\"card-body\">\n                    <p >Facebook pages are used to establish a business or organization on Facebook. They provide a service to post, add images, a contact number and website address. They allow you to engage with your audience.\n                            Hashtags are really useful to get some free traffic.\n                    </p>            \n            </div>\n          </div>\n        </div>\n       \n      </div>\n\n\n\n\n\n\n\n\n<img src=\"../../../assets/fb1.png\" alt=\"\" class=\"full\">\n</section>\n<section id='sem'>\n    <h3 class=\"text-center\">Search Engine Marketing (Ads)</h3>\n\n    <div id=\"accordion1\">\n            <div class=\"card\">\n              <div class=\"card-header\" id=\"headingOne1\">\n                <h5 class=\"mb-0\">\n                  <button class=\"btn btn-link\" data-toggle=\"collapse\" data-target=\"#collapseOne1\" aria-expanded=\"true\" aria-controls=\"collapseOne1\">\n                    Introduction\n                  </button>\n                </h5>\n              </div>\n          \n              <div id=\"collapseOne1\" class=\"collapse show\" aria-labelledby=\"headingOne1\" data-parent=\"#accordion1\">\n                <div class=\"card-body\">\n                        <p >Search engine marketing or sometimes known as PPC (Pay-Per-Click), is mainly Bing and Google's advertising solution on their search engine, to get at the top of the search results. Pay Per Click means literally, you pay for every prospect that clicks your search ad.\n                                Google Ads is the most popular and is very cost effective. Cost depends on competition for the keywords you would like to be searched for. For example, insurance would be a very costly keyword to advertise with as there are many insurance companies all doing the same thing.\n                                Bing Ads is the same as Google for the most part only, it's a little less popular. We recommend you do both, to get the maximum results. \n                            </p>\n                </div>\n              </div>\n            </div>\n            <div class=\"card\">\n              <div class=\"card-header\" id=\"headingTwo1\">\n                <h5 class=\"mb-0\">\n                  <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapseTwo1\" aria-expanded=\"false\" aria-controls=\"collapseTwo1\">\n                    Steps\n                  </button>\n                </h5>\n              </div>\n              <div id=\"collapseTwo1\" class=\"collapse\" aria-labelledby=\"headingTwo1\" data-parent=\"#accordion1\">\n                <div class=\"card-body\">\n\n                        <h5  >People wishing to advertise with search engine marketing are prompted to:</h5>\n\n                        <ul   class=\"list-group\">\n                            <li class=\"list-group-item\">Conduct keyword research and select a set of keywords related to their website or product</li>\n                            <li class=\"list-group-item\">Select a geographic location for the ad to be displayed within</li>\n                            <li class=\"list-group-item\">Create a text-based ad to display in the search results</li>\n                            <li class=\"list-group-item\">Bid on a price they are willing to pay for each click on their ad.</li>\n                        </ul>                </div>\n              </div>\n            </div>\n            <div class=\"card\">\n              <div class=\"card-header\" id=\"headingThree1\">\n                <h5 class=\"mb-0\">\n                  <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapseThree1\" aria-expanded=\"false\" aria-controls=\"collapseThree1\">\n                    Applications\n                  </button>\n                </h5>\n              </div>\n              <div id=\"collapseThree1\" class=\"collapse\" aria-labelledby=\"headingThree1\" data-parent=\"#accordion1\">\n                <div class=\"card-body\">\n                        <p>Search Engine Marketing is applicable to those who want to boost website traffic.</p>                </div>\n              </div>\n            </div>\n          </div>\n\n\n\n\n\n\n\n\n\n\n\n\n<img src=\"../../../assets/googbing.png\" alt=\"\" class=\"full\">\n</section>\n\n<section id='email'>\n<h3 class=\"text-center\">Email Marketing</h3>\n\n\n<div id=\"accordion2\">\n        <div class=\"card\">\n          <div class=\"card-header\" id=\"headingOne2\">\n            <h5 class=\"mb-0\">\n              <button class=\"btn btn-link\" data-toggle=\"collapse\" data-target=\"#collapseOne2\" aria-expanded=\"true\" aria-controls=\"collapseOne2\">\n                Introduction\n              </button>\n            </h5>\n          </div>\n      \n          <div id=\"collapseOne2\" class=\"collapse show\" aria-labelledby=\"headingOne2\" data-parent=\"#accordion2\">\n            <div class=\"card-body\">\n                    <p>Email marketing is the process of sending emails to promote a website, product or service. It involves writing pitches and copy to get the interest of a prospect. You can use any email client but you must stay within the sending limits of your provider. Sending limits vary from provider to provider.</p>\n                </div>\n          </div>\n        </div>\n        <div class=\"card\">\n          <div class=\"card-header\" id=\"headingTwo2\">\n            <h5 class=\"mb-0\">\n              <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapseTwo2\" aria-expanded=\"false\" aria-controls=\"collapseTwo2\">\n                Services\n              </button>\n            </h5>\n          </div>\n          <div id=\"collapseTwo2\" class=\"collapse\" aria-labelledby=\"headingTwo2\" data-parent=\"#accordion2\">\n            <div class=\"card-body\">\n                    <h5 >Some mass mail sending programs (require an email subscriber list)</h5>\n                    <ul  class=\"list-group\">\n                        <li  class=\"list-group-item\">Mailchimp</li>\n                    <li  class=\"list-group-item\">ActiveCampaign</li>\n                    <li  class=\"list-group-item\">Amazon SES</li>\n                    <li  class=\"list-group-item\">MailGun</li>\n                    <li  class=\"list-group-item\">SendGrid</li>\n                    </ul>\n                            </div>\n          </div>\n        </div>\n        <div class=\"card\">\n          <div class=\"card-header\" id=\"headingThree2\">\n            <h5 class=\"mb-0\">\n              <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapseThree2\" aria-expanded=\"false\" aria-controls=\"collapseThree2\">\n                Advantages\n              </button>\n            </h5>\n          </div>\n          <div id=\"collapseThree2\" class=\"collapse\" aria-labelledby=\"headingThree2\" data-parent=\"#accordion2\">\n            <div class=\"card-body\">\n                    <h5 >Advantages of email marketing</h5>\n\n                    <ul  class=\"list-group\">\n                    <li  class=\"list-group-item\">Free or cheap</li>\n                    <li  class=\"list-group-item\">Massive customer base</li>\n                    <li  class=\"list-group-item\">Fast</li></ul>            </div>\n          </div>\n        </div>\n      </div>\n\n\n\n\n    \n\n    <img src=\"../../../assets/mailchimp.png\" alt=\"\" class=\"full\">\n</section>\n    <section id='lnkd'>\n<h3 class=\"text-center\">LinkedIn Ads & Pages</h3>\n\n<div id=\"accordion3\">\n        <div class=\"card\">\n          <div class=\"card-header\" id=\"headingOne3\">\n            <h5 class=\"mb-0\">\n              <button class=\"btn btn-link\" data-toggle=\"collapse\" data-target=\"#collapseOne3\" aria-expanded=\"true\" aria-controls=\"collapseOne3\">\n                Introduction\n              </button>\n            </h5>\n          </div>\n      \n          <div id=\"collapseOne3\" class=\"collapse show\" aria-labelledby=\"headingOne3\" data-parent=\"#accordion3\">\n            <div class=\"card-body\">\n                \n\n<p >LinkedIn is a popular social network, aimed at professionals. It is particularly useful when you want to target executives and business owners as they will have profiles and company pages. It's more expensive than Facebook but could have higher returns as the customer base is more wealthy (in general).\n        LinkedIn Sales Navigator is a paid product that allows you to perform complex and filtered searches of people in your country or internationally. It allows you to select a company position, company, company size and so much more. It allows you to find a subset of professionals performed by giving characteristics. nkedIn profiles contain more detailed and up-to-date “professional” information compared to what people list on their personal profiles on Facebook, etc.\n       \n       </p>\n       \n            </div>\n          </div>\n        </div>\n        <div class=\"card\">\n          <div class=\"card-header\" id=\"headingTwo3\">\n            <h5 class=\"mb-0\">\n              <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapseTwo3\" aria-expanded=\"false\" aria-controls=\"collapseTwo3\">\n                Creation\n              </button>\n            </h5>\n          </div>\n          <div id=\"collapseTwo3\" class=\"collapse\" aria-labelledby=\"headingTwo3\" data-parent=\"#accordion3\">\n            <div class=\"card-body\">\n                    <h5 >To create an Ad you need the following: </h5>\n                    <ul  class=\"list-group\"> \n                            <li  class=\"list-group-item\">A LinkedIn account</li>\n                            <li  class=\"list-group-item\">Basic understanding of your audience</li>\n                            <li  class=\"list-group-item\">Ad copy</li>\n                            <li  class=\"list-group-item\">Video (optional)</li>\n                            </ul>\n            </div>\n          </div>\n        </div>\n       <!-- <div class=\"card\">\n          <div class=\"card-header\" id=\"headingThree3\">\n            <h5 class=\"mb-0\">\n              <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapseThree3\" aria-expanded=\"false\" aria-controls=\"collapseThree3\">\n                Advantages\n              </button>\n            </h5>\n          </div>\n          <div id=\"collapseThree3\" class=\"collapse\" aria-labelledby=\"headingThree3\" data-parent=\"#accordion3\">\n            <div class=\"card-body\">\n\n    \n            </div>\n          </div>\n        </div>\n\n        -->\n      </div>\n\n\n\n\n\n<img src=\"../../../assets/linkedin_logo_1-1024x675.jpg\" alt=\"\" class=\"full\">\n</section>\n <section id='yt'>\n<h3 class=\"text-center\">YouTube Ads & Channels</h3>\n\n<div id=\"accordion4\">\n        <div class=\"card\">\n          <div class=\"card-header\" id=\"headingOne4\">\n            <h5 class=\"mb-0\">\n              <button class=\"btn btn-link\" data-toggle=\"collapse\" data-target=\"#collapseOne4\" aria-expanded=\"true\" aria-controls=\"collapseOne4\">\n                Introduction\n              </button>\n            </h5>\n          </div>\n      \n          <div id=\"collapseOne4\" class=\"collapse show\" aria-labelledby=\"headingOne4\" data-parent=\"#accordion4\">\n            <div class=\"card-body\">\n                    <p >YouTube is the second most popular search engine in the world. Trailing behind Google, it's extremely popular. There is a video advertising solution offered by them that allows a marketer to place videos before standard videos to show the people your products, services and business. Costs vary, but it could definitly be worth the investment. Apart from YouTube ads, there's a free option. You can upload your own videos promoting your products or services. It works very well to build\n                            up a subscriber base. Then sell to them after. One strategy is to provide either informative or entertaining content and try to sell to them after.\n                        </p>\n            </div>\n          </div>\n        </div>\n        <div class=\"card\">\n          <div class=\"card-header\" id=\"headingTwo4\">\n            <h5 class=\"mb-0\">\n              <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapseTwo4\" aria-expanded=\"false\" aria-controls=\"collapseTwo4\">\n                Services\n              </button>\n            </h5>\n          </div>\n          <div id=\"collapseTwo4\" class=\"collapse\" aria-labelledby=\"headingTwo4\" data-parent=\"#accordion4\">\n            <div class=\"card-body\">\n                    <p>We can launch you, an advertisement on YouTube or create you a channel. We will go to third party sources, get a video advertisement made up for you and post it onto their advertising platform.\n\n                </p>\n                \n            </div>\n          </div>\n        </div>\n        <!--<div class=\"card\">\n          <div class=\"card-header\" id=\"headingThree4\">\n            <h5 class=\"mb-0\">\n              <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapseThree4\" aria-expanded=\"false\" aria-controls=\"collapseThree4\">\n                Advantages\n              </button>\n            </h5>\n          </div>\n          <div id=\"collapseThree4\" class=\"collapse\" aria-labelledby=\"headingThree4\" data-parent=\"#accordion4\">\n            <div class=\"card-body\">\n\n    \n            </div>\n          </div>\n        </div>-->\n      </div>\n\n\n\n\n\n<img src=\"../../../assets/youtube.png\" alt=\"\" class=\"full\">\n</section>\n<section id='seo'>\n<h3 class=\"text-center\">Search Engine Optimization</h3>\n<div id=\"accordion5\">\n        <div class=\"card\">\n          <div class=\"card-header\" id=\"headingOne5\">\n            <h5 class=\"mb-0\">\n              <button class=\"btn btn-link\" data-toggle=\"collapse\" data-target=\"#collapseOne5\" aria-expanded=\"true\" aria-controls=\"collapseOne5\">\n                Introduction\n              </button>\n            </h5>\n          </div>\n      \n          <div id=\"collapseOne5\" class=\"collapse show\" aria-labelledby=\"headingOne5\" data-parent=\"#accordion5\">\n            <div class=\"card-body\">\n                    <p>Search Engine Optimization or SEO, for short is the process of applying certain design techniques to websites to improve their search engine rankings. There are many approaches and it's best to apply all. Meta tags are information about information and they are at the start of the header tag in a HTML file. There are two main ones you use in SEO, meta description and meta keywords. Description is what will display in the search engine results under the link you click. You see this all the time. Meta keywords are words that you want your website to be shown for. There is a rough guidline to use about 10 and \n                            they are heavily used in the Google and Bing Search algorithms. Another strategy is to use the content of your website. Make sure to use keywords through paragraphs and header text. The algorithms also like the page names of your HTML documents. If using a JavaScript framework this will be the titles of your routes. The domain itself is heavily used for keywords and it makes sense to describe your service in your business name. \n                        </p>\n                        \n            </div>\n          </div>\n        </div>\n        <div class=\"card\">\n          <div class=\"card-header\" id=\"headingTwo5\">\n            <h5 class=\"mb-0\">\n              <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapseTwo5\" aria-expanded=\"false\" aria-controls=\"collapseTwo5\">\n                Strategy\n              </button>\n            </h5>\n          </div>\n          <div id=\"collapseTwo5\" class=\"collapse\" aria-labelledby=\"headingTwo5\" data-parent=\"#accordion5\">\n            <div class=\"card-body\">\n                    <h5>SEO strategy</h5>\n                    <ul class=\"list-group\">\n                        <li class=\"list-group-item\">Meta description</li>\n                        <li class=\"list-group-item\">Meta keywords</li>\n                        <li class=\"list-group-item\">Title and paragraph content</li>\n                        <li class=\"list-group-item\">Domain itself</li>\n                        <li class=\"list-group-item\">Routes/Page names</li>\n                        <li class=\"list-group-item\">Link building</li>\n                    </ul>\n            </div>\n          </div>\n        </div>\n\n        <!---\n        <div class=\"card\">\n          <div class=\"card-header\" id=\"headingThree5\">\n            <h5 class=\"mb-0\">\n              <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapseThree5\" aria-expanded=\"false\" aria-controls=\"collapseThree5\">\n                Advantages\n              </button>\n            </h5>\n          </div>\n          <div id=\"collapseThree5\" class=\"collapse\" aria-labelledby=\"headingThree5\" data-parent=\"#accordion5\">\n            <div class=\"card-body\">\n\n    \n            </div>\n          </div>\n        </div>\n        -->\n      </div>\n\n\n\n<img src=\"../../../assets/unnamed.jpg\" alt=\"\" class=\"full\">\n</section>\n<section id='twitter'>\n<h3 class=\"text-center\">Twitter Ads & Pages</h3>\n\n<div id=\"accordion6\">\n        <div class=\"card\">\n          <div class=\"card-header\" id=\"headingOne6\">\n            <h5 class=\"mb-0\">\n              <button class=\"btn btn-link\" data-toggle=\"collapse\" data-target=\"#collapseOne6\" aria-expanded=\"true\" aria-controls=\"collapseOne6\">\n                Introduction\n              </button>\n            </h5>\n          </div>\n      \n          <div id=\"collapseOne6\" class=\"collapse show\" aria-labelledby=\"headingOne6\" data-parent=\"#accordion6\">\n            <div class=\"card-body\">\n                    <p >Twitter is a well established social network. Even though all Twitter Ads are tagged with the phrase, “Promoted”, they look like every other non-sponsored tweet. The goal of launching a promotional campaign on Twitter is to increase the reach of your posts.  At the same time, and thanks to social medias’ ability to segment audiences extremely well, you can focus on getting those users who comply with your target audience.\n\n                            Twitter Ads works similarly to advertising on Google AdWords. However, in lieu of establishing pay/cost per click (PPC/CPC respectively), a ‘cost per engagement’ (CPE) formula is implemented. This simply means that you only pay when users interact with an Ad; in other words, when a user clicks on it, expands it, RTs it, favorites it or responds to it.  </p>\n            </div>\n          </div>\n        </div>\n        <div class=\"card\">\n          <div class=\"card-header\" id=\"headingTwo6\">\n            <h5 class=\"mb-0\">\n              <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapseTwo6\" aria-expanded=\"false\" aria-controls=\"collapseTwo6\">\n                Advantages\n              </button>\n            </h5>\n          </div>\n          <div id=\"collapseTwo6\" class=\"collapse\" aria-labelledby=\"headingTwo6\" data-parent=\"#accordion6\">\n            <div class=\"card-body\">\n                    <ul  class=\"list-group\">\n                            <li  class=\"list-group-item\"><strong>Immediacy</strong><span>: Twitter is the ‘microblogging’ social network and is primarily characterized by its shortness. On Twitter, the “here and now” is what’s important. In this sense, the obtained results (assuming everything is well-planned) come quickly.</span></li>\n                            <li  class=\"list-group-item\"><strong>Effective Business Goals</strong><span>: thanks to the different types of campaigns offered by </span><strong>Twitter Ads</strong><span>, (in addition to its massive network of users), it’s quite easy to put together attainable business goals with the help of Twitter Ads. As an added bonus, you can also measure the progress/statistics of your ads. </span></li>\n                            <li   class=\"list-group-item\"><strong>User integration</strong><span>: even though advertised tweets are tagged with the word “Promoted”, (which is clearly visible amongst ‘organic tweets’), they are seamlessly integrated within a user’s timeline and offer the same reactionary options as non-promoted tweets (e.g. RT, like, etc.) </span></li>\n                            <li  class=\"list-group-item\"><strong>Multi-display and mobile version</strong><span>: Twitter allows for a perfect viewing experience regardless of the screen size/type; it's also perfectly optimized for cell phones. This is extremely relevant today and it will be even more so in the future since, every day, there are more and more people using their phones instead of their computers. &nbsp;</span></li>\n                            <li  class=\"list-group-item\"><strong>Better CTR</strong><span>: various studies have concluded that </span><strong>Twitter Ads</strong><span> have a better CTR maintained over time. Compared to the rest of the social media networks, Twitter Ads seem to be more effective in this field. This could be due to the fact that there are less companies taking advantage of Twitter than there are with other social networks (which are already quite saturated).</span>&nbsp;</li>\n                            </ul>\n            </div>\n          </div>\n        </div>\n        <div class=\"card\">\n          <div class=\"card-header\" id=\"headingThree6\">\n            <h5 class=\"mb-0\">\n              <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapseThree6\" aria-expanded=\"false\" aria-controls=\"collapseThree6\">\n                Free Account \n              </button>\n            </h5>\n          </div>\n          <div id=\"collapseThree6\" class=\"collapse\" aria-labelledby=\"headingThree6\" data-parent=\"#accordion6\">\n            <div class=\"card-body\">\n\n                    <p>Apart from choosing Twitter Ads to get a good CPE price, you can choose the free option. Simply create a twitter account, gain some followers and post regularly. Use hashtags to your advantage to scale your posts worldwide.</p>\n    \n            </div>\n          </div>\n        </div>\n      </div>\n\n\n\n        \n\n\n<img src=\"../../../assets/aboutog.png\" alt=\"\" class=\"full\">\n</section>\n<section id='ads'>\n\n\n<h3 class=\"text-center\">Google AdSense</h3>\n\n<div id=\"accordion7\">\n        <div class=\"card\">\n          <div class=\"card-header\" id=\"headingOne7\">\n            <h5 class=\"mb-0\">\n              <button class=\"btn btn-link\" data-toggle=\"collapse\" data-target=\"#collapseOne7\" aria-expanded=\"true\" aria-controls=\"collapseOne7\">\n                Introduction\n              </button>\n            </h5>\n          </div>\n      \n          <div id=\"collapseOne7\" class=\"collapse show\" aria-labelledby=\"headingOne7\" data-parent=\"#accordion7\">\n            <div class=\"card-body\">\n                    <p>Google AdSense are the add pictures you see on most popular websites online. It is the advertising solution for website users that want to monetize their traffic or on the flip-side if someone wants to get more traffic they can pay for Google AdSense Ads.</p>\n            </div>\n          </div>\n        </div>\n        <div class=\"card\">\n          <div class=\"card-header\" id=\"headingTwo7\">\n            <h5 class=\"mb-0\">\n              <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapseTwo7\" aria-expanded=\"false\" aria-controls=\"collapseTwo7\">\n                Advantages\n              </button>\n            </h5>\n          </div>\n          <div id=\"collapseTwo7\" class=\"collapse\" aria-labelledby=\"headingTwo7\" data-parent=\"#accordion7\">\n            <div class=\"card-body\">\n                    <h5>Why Choose Google AdSense as an advertiser</h5>\n                    <ul class=\"list-group\">\n                        <li class=\"list-group-item\">Cheap</li>\n                        <li class=\"list-group-item\">Established</li>\n                        <li class=\"list-group-item\">Huge Customer Base</li>\n                        <li class=\"list-group-item\">Targeted</li>\n                    </ul>\n            </div>\n          </div>\n        </div>\n        <div class=\"card\">\n          <div class=\"card-header\" id=\"headingThree7\">\n            <h5 class=\"mb-0\">\n              <button class=\"btn btn-link collapsed\" data-toggle=\"collapse\" data-target=\"#collapseThree7\" aria-expanded=\"false\" aria-controls=\"collapseThree7\">\n                Contact\n              </button>\n            </h5>\n          </div>\n          <div id=\"collapseThree7\" class=\"collapse\" aria-labelledby=\"headingThree7\" data-parent=\"#accordion7\">\n            <div class=\"card-body\">\n\n                    <p>Get in touch today and we will help you monetize your website, or advertise it with Google AdSense.</p>\n    \n            </div>\n          </div>\n        </div>\n      </div>\n\n\n\n\n\n\n<img src=\"../../../assets/ga.png\" alt=\"\" class=\"full\" id=\"sad\">\n</section>\n</div>"

